28.body:
The milestone based scoring defines a tip's score by investigating the tip's relation to the cone it approves and previous issued milestones. A tip can have one of 3 score states: 0: The tip is lazy and should not be selected. 1: The tip is somewhat lazy. 2: The tip is a non-lazy tip. Definitions: C1: Max allowed delta value for the YTRSI of a given transaction in relation to the current LSMI. C2: Max allowed delta value between OTRSI of the approvees of a given transaction in relation to the current LSMI. M: Max allowed delta value between OTRSI of the given transaction in relation to the current LSMI. M is the below max depth (BMD) parameter. Recommended defaults: C1 = 2 milestones C2 = 7 milestones M = 15 milestones Scoring Algorithm (pseudo code): enum Score ( LAZY = 0 SEMI_LAZY = 1 NON_LAZY = 2
) const ( C1 = 2 C2 = 7 M = 15
) func score(tip Tip) Score { // if the LSMI to YTRSI delta is over C1, then the tip is lazy if (LSMI - YTRSI(tip) > C1) { return Score.LAZY } // if the OTRSI to LSMI delta is over M/below-max-depth, then the tip is lazy if (LSMI - OTRSI(tip) > M) { return Score.LAZY } // the approvees (trunk and branch) are the tail transactions this tip approves approvees := tip.Approvees() approveesOTRSICheck := 2 for (i := 0; i < 2; i++) { approvee := approvees[i] // direct approvee is already lazy, therefore so is this tip if (approvee.Score == 0) { return Score.LAZY } // if the OTRSI to LSMI delta of the approvee is above C2, we mark it as such if (LSMI - OTRSI(approvee) > C2) { approveesOTRSICheck-- } } // if both approvees' OTRSI violates the LSMI delta in relation to C2 the tip is lazy too if (approveesOTRSICheck == 0) { return Score.LAZY } // if only one of the approvees violated the OTRSI to LMSI delta, the tip is considered semi-lazy if (approveesOTRSICheck == 1) { return Score.SEMI_LAZY } return Score.NON_LAZY
}

