Given the scoring, a node should keep a set of semi-/non-lazy tips with their associated score. A node must not execute tip-selection if it is not synchronized. Tip-Selection (pseudo code): // a set which contains only semi- and non-lazy tips
var tips = Set(tips_and_score) func select() Tip { // if we have no semi-/non-lazy tips, we return null if (tips.length == 0) { return null } // compute the sum of the score of all tips scoreSum := tips.ScoreSum() // get a random number between 1 and the score sum r := rand.Int(1, scoreSum) // iterate over the tips set and subtract each tip's score from r for (i := 0; i < tips.length; i++){ // subtract the tip's score from r r -= tips[i].Score // if r reaches zero or below, we return the given tip if (r <= 0) { return tips[i] } } // no tips return null
} A tip should not be removed from the tips set immediately after it was selected in select(), in order to make it possible for it to be re-selected, which in turn makes the Tangle wider and improves synchronization speed. A tip is removed from the tips set if X amount of direct approvers are reached. It is recommended to use 2 for X but the threshold should be configurable.
